import logo from './logo.svg';
import './App.css';
import MyButton from './Components/Button';

function MyOtherButton() {
  return (
    <button>Segundo botón</button>
  );
}

function App() {
  return (
  <>
    <h1>Boton importado de la carpeta Components.</h1>
    <MyButton/>
    <h1>Botón creado desde App.js</h1>
    <MyOtherButton/>
  </>
);
}

export default App;
